//{{{  cacheState

nodeStruct.prototype.cacheState = function() {

  const s = this.state;

  this.cacheTurn   = s.turn;
  this.cacheRights = s.rights;
  this.cacheEp     = s.ep;
}

//}}}
//{{{  uncacheState

nodeStruct.prototype.uncacheState = function() {

   const s = this.state;

   s.turn   = this.cacheTurn;
   s.rights = this.cacheRights;
   s.ep     = this.cacheEp;
}

