//{{{  playMove

function playMove (uciMove) {

  const node = nodes[0];
  const s    = node.state;

  node.initMoveGen(0, 0);

  var move = 0;

  node.cacheState();

  while (move = node.getNextMove()) {

    if (formatMove(move) == uciMove) {
      makeMove(move);
      return;
    }

    unmakeMove(move);
    node.uncacheState();
  }

  console.log('cannot play uci move', uciMove);
}

//}}}
//{{{  go

function go () {

  const h = hash;

  h.ttType.fill(0);

  const t = timing;

  t.bm    = 0;
  t.done  = 0;
  t.nodes = 0;

  const node = nodes[0];

  var score = 0;
  var alpha = 0;
  var beta  = 0;
  var delta = 0;

  for (let ply=1; ply <= t.targetDepth; ply++) {

    alpha = -MATE;
    beta  = MATE;
    delta = 10;

    if (ply >= 4) {
      alpha = Math.max(-MATE, score - delta);
      beta  = Math.min(MATE,  score + delta);
    }

    while (1) {

      score = search(node, alpha, beta, ply, 0);

      if (t.done)
        break;

      if (score > alpha && score < beta) {
        uciSend('info', 'depth', ply, 'nodes', t.nodes, 'score', score, 'pv', formatMove(t.bm));
        break;
      }

      delta += delta / 2 | 0;

      if (score <= alpha) {
        uciSend('info', 'depth', ply, 'nodes', t.nodes, 'lowerbound', score);
        alpha = Math.max(-MATE, score - delta);
        beta  = Math.min(MATE, ((alpha + beta) / 2) | 0);
        t.bm = 0;
      }
      else if (score >= beta) {
        uciSend('info', 'depth', ply, 'nodes', t.nodes, 'upperbound', score);
        alpha = Math.max(-MATE, ((alpha + beta) / 2) | 0);
        beta  = Math.min(MATE,  score + delta);
      }
    }

    if (t.done)
      break;
  }

  uciSend('bestmove', formatMove(timing.bm));
}

//}}}
//{{{  search

function search (node, alpha, beta, depth, moved) {

  //{{{  housekeeping
  
  const t = timing;
  
  t.nodes++;
  
  if (t.bm && (
                (t.finishTime  && (Date.now() >  t.finishTime))  ||
                (t.targetNodes && (t.nodes    >= t.targetNodes)) ||
                !node.child
               )){
  
    t.done = 1;
    return 0;
  }
  
  //}}}

  const s = node.state;

  const oAlpha    = alpha;
  const pvNode    = alpha != (beta - 1);
  const rootNode  = node.ply == 1;
  const turn      = s.turn;
  const nextTurn  = colourToggle(turn);
  const cx        = colourIndex(turn);
  const inCheck   = isInCheckAfterTheirMove(s.kings[cx], nextTurn, moved);

  var bestScore = -MATE;
  var bestMove  = 0;

  if (depth <= 0 && !inCheck)
    return qsearch(node, alpha, beta, depth, moved);

  node.cacheState();

  var move   = 0;
  var score  = 0;
  var played = 0;

  node.initMoveGen(inCheck, moved);

  while (move = node.getNextMove()) {

    makeMove(move);

    if (!(move & MOVE_LEGAL_MASK) && isInCheckAfterOurMove(inCheck, s.kings[cx], nextTurn, move)) {
      //{{{  legal?
      
      unmakeMove(move);
      node.uncacheState();
      
      continue;
      
      //}}}
    }

    played++;

    score = -search(node.child, -beta, -alpha, depth-1, move);

    unmakeMove(move);
    node.uncacheState();

    if (timing.done)
      return 0;

    if (score > bestScore) {
      bestScore = score;
      bestMove  = move;
      if (score > alpha) {
        alpha = score;
        if (rootNode) {
          timing.bm = move;
        }
        if (score >= beta) {
          return score;
        }
      }
    }
  }

  if (!played)
    return inCheck ? -MATE + node.ply : 0;
  else
    return bestScore;
}

//}}}
//{{{  qsearch

function qsearch (node, alpha, beta, depth, moved) {

  //{{{  housekeeping
  
  const t = timing;
  
  t.nodes++;
  
  if (t.bm && (
                (t.finishTime  && (Date.now() >  t.finishTime))  ||
                (t.targetNodes && (t.nodes    >= t.targetNodes)) ||
                !node.child
               )){
  
    t.done = 1;
    return 0;
  }
  
  //}}}

  const e = evaluate();

  if (e >= beta)
    return e;

  if (alpha < e)
    alpha = e;

  const s = node.state;

  const turn      = s.turn;
  const nextTurn  = colourToggle(turn);
  const cx        = colourIndex(turn);
  const inCheck   = isInCheckAfterTheirMove(s.kings[cx], nextTurn, moved);

  node.cacheState();

  var move   = 0;
  var score  = 0;
  var played = 0;

  node.initMoveGen(inCheck, moved);

  while (move = node.getNextMove()) {

    if (node.stage > 1)
      break;

    if (!(move & MOVE_CAPTURE_MASK)) {
      continue;
    }

    makeMove(move);

    if (!(move & MOVE_LEGAL_MASK) && isInCheckAfterOurMove(inCheck, s.kings[cx], nextTurn, move)) {
      //{{{  legal?
      
      unmakeMove(move);
      node.uncacheState();
      
      continue;
      
      //}}}
    }

    played++;

    score = -qsearch(node.child, -beta, -alpha, depth-1, move);

    unmakeMove(move);
    node.uncacheState();

    if (timing.done)
      return 0;

    if (score > alpha) {
      alpha = score;
      if (score >= beta) {
        return score;
      }
    }
  }

  return alpha;
}

//}}}
//{{{  perft

function perft (node, depth, moved) {

  if (depth == 0)
    return 1;

  const s = node.state;

  const turn      = s.turn;
  const nextTurn  = colourToggle(turn);
  const cx        = colourIndex(turn);
  const inCheck   = isInCheckAfterTheirMove(s.kings[cx], nextTurn, moved);

  node.cacheState();

  var count = 0;
  var move  = 0;

  node.initMoveGen(inCheck, moved);

  while (move = node.getNextMove()) {

    makeMove(move);

    if (!(move & MOVE_LEGAL_MASK) && isInCheckAfterOurMove(inCheck, s.kings[cx], nextTurn, move)) {
      unmakeMove(move);
      node.uncacheState();
      continue;
    }

    count += perft(node.child, depth-1, move);

    unmakeMove(move);
    node.uncacheState();
  }

  return count;
}

