//{{{  uciPost

function uciPost (s) {
  console.log(s);
}

//}}}
//{{{  uciSend

function uciSend () {

  var s = '';

  for (var i = 0; i < arguments.length; i++)
    s += arguments[i] + ' ';

  uciPost(s);
}

